import React from "react";
import { gql } from 'apollo-boost';
import { useQuery } from '@apollo/react-hooks';
import { typeDefs } from './BaseballApp';
//import { baseballActions } from '../state';
//import { useStateValue } from './BaseballApp';
//let NAME_SEARCH_URL: string = "http://192.168.1.67:5000/player?str="

/*type Player =  {
  searchStr: string,
  name: string,
  id: number
}*/

type NameSearchProps = {
  playerText: string,
}

const PLAYER_QUERY = gql`
  {
    getPlayer(searchStr: "Christian Yel")
    {
      searchStr
      name
      id
    }
  }
`;

// NameSearch function for taking text entered and searching for closest player
// whose name matches the text
function NameSearch(): any {
  // https://github.com/apollographql/apollo-client/blob/version-2.6/docs/source/data/queries.mdx
  const { loading, error, data } = useQuery(PLAYER_QUERY, {variables: { searchStr: ''}});
  if (loading) return (<div>'Loading...'</div>);
  if (error) {
    console.warn(error);
    return (<div>`Error! ${error.message}`</div>);
  }

  console.log(data);
  cache.writeData({
    data: {
      //searchStr: searchStr,
      name: data.getPlayer.name,
      id: data.getPlayer.id,
    }
  })
  return (
    <div>
      <input placeholder="Enter Player's Name" />
      <br/>
      <h3>{data.getPlayer.name}</h3>
    </div>
  )
  /*return (
    <div>
      <input placeholder="Enter Player's Name" name="playerText" value={ data.getPlayer.searchStr } onChange={onPlayerTextEntered} />
      <br />
      <h3>{ data.getPlayer.name }</h3>
    </div>
  );*/
};

export default NameSearch;
